sources.styles/reset.scss:
* {
  box-sizing: border-box;
}

body,
h1,
h2,
h3,
h4,
h5,
h6 {
  font-weight: normal;
}

a {
  text-decoration: none;
}

sources.styles/utils/_extends.scss:
%nav-text-style {
  font-weight: bold;
  color: $text-color-dark;
  text-decoration: none;
  text-transform: uppercase;
}

sources.styles/blocks/page.scss:
.page {
  font-family: "Inter", sans-serif;
  font-size: 16px;
  line-height: 22px;
  color: $text-color-dark;
  scroll-behavior: smooth;

  &__body {
    margin: 0;

    &--with-menu {
      overflow: hidden;
    }
  }

  &__menu {
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    margin-bottom: 32px;

    @include onTablet {
      margin-bottom: 56px;
    }

    transform: translateX(100%);
    transition: transform $transition-duration;

    &:target {
      transform: translateX(0);
    }
  }

  &__section {
    margin: 0 0 120px;
  }

  &__section-title {
    margin: 0 0 48px;

    font-size: 32px;
    line-height: 100%;
    font-weight: 700;
    letter-spacing: -1.5px;
    text-align: center;

    @include onTablet {
      margin: 0 0 64px;
      font-size: 40px;
    }

    @include onDesktop {
      font-size: 48px;
    }
  }
}

sources.styles/utils/_mixins.scss:
@mixin onXLDesktop {
  @media (min-width: 1280px) {
    @content;
  }
}

@mixin onDesktop {
  @media (min-width: 1024px) {
    @content;
  }
}

@mixin onTablet {
  @media (min-width: 576px) {
    @content;
  }
}

@mixin landscape {
  @media screen and (min-width:280px) and (max-width:940px) and (orientation:landscape) {
    @content;
  }
}

@mixin pageGrid {
  --columns: 2;
  display: grid;
  column-gap: 20px;
  grid-template-columns: repeat(var(--columns), 1fr);

  @include onTablet {
    --columns: 6;
    column-gap: 24px;
  }

  @include onDesktop {
    --columns: 12;
  }
}

sources.styles/blocks/container.scss:
.container {
  box-sizing: content-box;
  margin: 0 auto;
  max-width: 1020px;
  padding: 0 20px;

  @include onTablet {
    padding: 0 76px;
  }

  @include landscape {
    padding: 0 20px;
  }

  @include onDesktop {
    padding: 0 120px;
  }
}

sources.styles/blocks/header.scss:
.header {
  background-image: url(../images/header.png);
  background-size: cover;
  background-position: center;
  background-repeat: no-repeat;

  @include onXLDesktop {
    background-position-y: 40%;
  }

  &__content {
    display: flex;
    flex-direction: column;
    justify-content: space-between;

    box-sizing: border-box;
    height: 100vh;
    padding: 0 0 64px;

    @include landscape {
      padding: 0 0 24px;
    }
  }

  &__title {
    font-size: 32px;
    line-height: 100%;
    font-weight: 800;
    font-style: italic;
    letter-spacing: -1.5px;
    margin: 0;

    @include onTablet {
      font-size: 40px;
    }

    @include onDesktop {
      font-size: 48px;
    }

    &::before {
      content: "";
      display: block;
      width: 48px;
      height: 58px;
      background-image: url(../images/sound-waves.svg);
      background-size: cover;
      background-position: center;
      background-repeat: no-repeat;
      margin: 0 0 16px;

      @include onTablet {
        width: 64px;
        height: 76px;
        margin: 0 0 40px;
      }

      @include landscape {
        margin: 0 0 20px;
      }
    }
  }
}

sources.styles/blocks/icon.scss:
.icon {
  display: block;
  background-size: cover;
  background-position: center;
  background-repeat: no-repeat;
  width: $icon-size;
  height: $icon-size;

  @include onTablet {
    width: $icon-size-tablet;
    height: $icon-size-tablet;
  }

  &--menu {
    background-image: url(../images/icons/menu.svg);
    transition-duration: $transition-duration;

    @include onDesktop {
      &:hover {
        background-image: url(../images/icons/menu-hover.svg);
      }
    }
  }

  &--phone {
    background-image: url(../images/icons/phone.svg);
  }

  &--call {
    text-decoration: none;

    @include onDesktop {
      &::before {
        content: "+1 234 555-55-55";
        position: relative;
        top: 50%;
        transform: translate(-100%, -50%);
        transition-duration: $transition-duration;
        display: block;
        width: max-content;
        padding-right: 20px;

        font-weight: bold;
        font-size: 12px;
        line-height: 16px;
        color: $text-color-dark;
        letter-spacing: 2px;
        opacity: 0;
        pointer-events: none;
      }

      &:hover::before {
        opacity: 1;
        pointer-events: all;
      }
    }
  }

  &--cross {
    background-image: url(../images/icons/cross.svg);
  }
}

sources.styles/blocks/top-actions.scss:
.top-actions {
  display: flex;
  justify-content: space-between;
  align-items: center;

  padding: 24px 0;

  @include onTablet {
    padding: 32px 0;
  }

  @include landscape {
    padding: 2% 0;
  }

  &__logo {
    display: flex;
    height: 16px;

    @include onTablet {
      height: 24px;
    }
  }

  &__call-and-menu {
    display: flex;
    justify-content: space-between;
    align-items: center;
    gap: 24px;

    @include onTablet {
      gap: 48px;
    }
  }
}

sources.styles/blocks/menu.scss:
.menu {
  background-color: $menu-background-color;
  z-index: 1;

  &__content {
    height: 100vh;
  }

  &__nav {
    margin: 0 0 40px;

    @include landscape {
      margin: 0 0 10px;
    }
  }

  &__call {
    display: block;
    width: fit-content;

    @extend %nav-text-style;

    &--phone {
      font-size: 16px;
      line-height: 27px;
      margin: 0 0 16px;

      @include landscape {
        margin: 0;
      }
    }

    &--action {
      font-size: 12px;
      line-height: 16px;
      letter-spacing: 2px;
      padding-bottom: 8px;
      border-bottom: 1px solid $text-color-dark;

      @include landscape {
        padding-bottom: 4px;
      }
    }
  }
}

sources.styles/blocks/nav.scss:
.nav {
  &__list {
    padding: 0;
    list-style: none;
    display: flex;
    flex-direction: column;
    gap: 32px;

    @include landscape {
      gap: 4px;
    }
  }

  &__link {
    display: inline-block;
    padding-bottom: 8px;
    border-bottom: 1px solid transparent;

    @extend %nav-text-style;

    font-size: 22px;
    line-height: 22px;
    letter-spacing: 2px;
    transition: border-color $transition-duration;

    &:hover {
      border-color: $text-color-dark;
    }

    @include landscape {
      padding-bottom: 4px;
    }
  }
}

sources.styles/blocks/recommended.scss:
.recommended {
  &__products {
    @include pageGrid;
    row-gap: 40px;
  }

  &__product {
    grid-column: 1 / -1;

    @include onTablet {
      grid-column: 2 / -2;
    }

    @include onDesktop {
      grid-column: span 4;
    }
  }
}

sources.styles/blocks/product.scss:
.product {
  cursor: pointer;
  transition: transform $transition-duration linear;

  &:hover {
    transform: scale(1.05);
  }

  &__photo {
    width: 100%;
  }

  &__title {
    font-weight: 700;
    font-size: 16px;
  }

  &__price {
    font-weight: 700;
  }
}

sources.styles/blocks/categories.scss:
.categories {
  &__content {
    display: flex;
    flex-direction: column;
    gap: 40px;

    @include onTablet {
      gap: 64px;
    }
  }
}

sources.styles/blocks/category.scss:
.category {
  display: flex;
  flex-direction: column;
  gap: 16px;

  &__photos {
    @include pageGrid;
    row-gap: 16px;
  }

  &__link {
    position: relative;
    cursor: pointer;
    transition: transform $transition-duration linear;

    &:hover {
      transform: scale(1.05);
    }

    &--wide {
      @include onTablet {
        grid-column: span 4;
      }

      @include onDesktop {
        grid-column: span 8;
      }
    }

    &--square {
      height: 0;
      padding-bottom: 100%;

      @include onTablet {
        grid-column: span 2;
      }

      @include onDesktop {
        grid-column: span 4;
      }
    }
  }

  &__photo {
    position: absolute;
    height: 100%;
    width: 100%;
    object-fit: cover;
  }

  &__title {
    margin: 0;
    font-weight: 700;

    @include onTablet {
      font-size: 24px;
      line-height: 140%;
    }

    &-link {
      color: $text-color-dark;
      text-decoration: none;

      padding-bottom: 8px;
      border-bottom: 1px solid transparent;
      transition: border-color $transition-duration;

      &:hover {
        border-color: $text-color-dark;
      }
    }
  }

  &__button {
    @include pageGrid;
  }
}

sources.styles/blocks/how-to-buy.scss:
.how-to-buy {
  @include pageGrid;

  &__title {
    text-align: left;
    grid-column: 1 / -1;

    @include onTablet {
      grid-column: span 3;
    }

    @include onDesktop {
      grid-column: span 5;
    }
  }

  &__content {
    grid-column: 1 / -1;

    @include onTablet {
      grid-column: span 3;
    }

    @include onDesktop {
      grid-column: span 5;
    }
  }

  &__advantages {
    display: grid;
    row-gap: 16px;

    font-weight: 700;
    margin: 0 0 40px;
    padding: 0;
    list-style: none;
  }

  &__description {
    line-height: 27px;
  }
}

sources.styles/blocks/contacts.scss:
.contacts {
  &__content {
    @include pageGrid;
  }

  &__inputs {
    display: flex;
    flex-direction: column;
    gap: 16px;
    margin: 0;
    grid-column: 1 / -1;

    @include onTablet {
      grid-column: span 3;
    }

    @include onDesktop {
      grid-column: span 5;
    }
  }

  &__contacts {
    display: flex;
    flex-direction: column;
    gap: 24px;

    grid-column: 1 / -1;

    @include onTablet {
      grid-column: span 3;
    }

    @include onDesktop {
      grid-column: 8 / -1;
    }
  }

  &__unit {
    display: flex;
    flex-direction: column;
    gap: 8px;
  }

  &__contact {
    margin: 0;
    color: $text-color-grey;
    text-decoration: none;

    &:hover {
      color: $button-active-bg-color;
    }

    &-label {
      margin: 0;
      font-size: 14px;
      line-height: 140%;
      font-weight: 400;
      color: $contact-label-color;
    }
  }

  &__address-link {
    text-decoration: none;
  }
}

sources.styles/blocks/input.scss:
.input {
  padding: 14px 16px;
  background: $input-bg-color;
  border-radius: 40px;
  border: 1px solid $input-bg-color;
  width: 100%;
  height: 48px;

  &::placeholder {
    font-family: inherit;
    font-size: 14px;
    line-height: 20px;
    color: $input-placeholder-color;
    outline: none;
  }

  &--usermessage {
    font-family: inherit;
    font-size: 14px;
    line-height: 20px;
    height: 148px;
    border-radius: 16px;
    margin: 0 0 32px;
    resize: none;
  }

  &:hover {
    color: $text-color-dark;
    border: 1px solid $input-hover-border-color;

    &::placeholder{
      color: $text-color-dark;
    }
  }

  &:focus {
    border: 1px solid $text-color-dark;
    outline: none;
  }
}

sources.styles/blocks/button.scss:
.button {
  line-height: 27px;
  font-weight: 700;
  padding: 14px 0;
  margin: 0;
  text-align: center;
  color: $color-white;

  background-color: $text-color-dark;
  border: 3px solid $text-color-dark;
  border-radius: 40px;
  cursor: pointer;
  transition-duration: $transition-duration;

  &:hover {
    background-color: $color-white;
    border: 3px solid $text-color-dark;
    color: $text-color-dark;
  }

  &:active {
    background-color: $button-active-bg-color;
    color: $color-white;
  }

  &--view-all {
    width: 100%;
    grid-column: 1 / -1;

    @include onTablet {
      grid-column: 2 / -2;
    }

    @include onDesktop {
      grid-column: 5 / 9;
    }
  }

  &--send {
    margin: 0 0 30px;
    width: 100%;
  }
}

sources.styles/blocks/footer.scss:
.footer {
  height: 200px;
  background-image: url(../images/footer.png);
  background-size: cover;
  background-position: center;

  @include onTablet {
    height: 400px;
  }

  @include onDesktop {
    height: 460px;
  }
}
